import React from 'react'
import D3Node from '../d3Node/D3Node'

const Input = (props) => {
    const inputHandler = (event) => {
        <D3Node 
            name={event.value}
        />
    }

    return(
        <div>
            <input
                type='text'
                onInput={inputHandler}
            />
        </div>
    )
}

export default Input
